It is definitely LAKSA 👍👍
I must admit how I was deeply impressed with my 70yo mum who is still quite tech-savvy when she used WhatsApp to video call me during the circuit breaker period as we were living in different households 👍 The most memorable moment with my mother was when she visited me during my first few days in school. She purposely left home with packed food she had prepared, even when she was not sure if the school would let her see me since it was not visitation day. Eventually, she pleaded with the school administration to allow her to pass me the homemade food 👍 Getting to enjoy homemade food was every student's dream & while sharing the food with my friends at school, I literally boasted around about how I had the best mother in the whole world 👍👍 Hence, I would love to win this wonderful cast iron pot generously sponsored by @rinnai_sg for the MUM of my life 💗💗
